using GreenDonut;
using HotChocolate.Subscriptions;
using CovrMe.WebAPI.Models.Result;
using CovrMe.WebAPI.Services.LocalServices.Contracts;
using CovrMe.WebAPI.Services.Uniqa.Contracts;
using CovrMe.WebAPI.Shared.Constants;
using Microsoft.AspNetCore.Authorization;
using Microsoft.AspNetCore.Mvc;

namespace CovrMe.WebAPI.Controllers
{
    public class TestController : Controller
    {
        private ITopicEventSender _sender;
        private IUniqaInsuranceService _uniqaInsuranceService;
        private IReadWriteService _readWriteService;
        public TestController(ITopicEventSender sender, IUniqaInsuranceService uniqaInsuranceService,
            IReadWriteService readWriteService)
        {
            this._sender = sender;
            this._uniqaInsuranceService = uniqaInsuranceService;
            this._readWriteService = readWriteService;
        }
        [HttpGet]
        [RequireHttps]
        [Route(GlobalConstants.TestSubscription)]
        public async Task<IActionResult> TestSubscription()
        {
            var baseResult = new BaseResultModel();
            baseResult.Code = 1;

            await _sender.SendAsync("1111", baseResult);
            var result = new
            {
                Success = true,
            };

            if (result != null)
            {
                return Ok(result);
            }

            else
                return BadRequest();
        }

        [HttpGet]
        [RequireHttps]
        [Route(GlobalConstants.TestAuth)]
        [Authorize(AuthenticationSchemes = GlobalConstants.AuthenticationSchemes)]
        public async Task<IActionResult> TestAuth()
        {
            var result = new
            {
                Success = true,
            };

            if (result != null)
            {
                return Ok(result);
            }

            else
                return BadRequest();
        }

        [HttpGet]
        [RequireHttps]
        [Route(GlobalConstants.TestApi)]
        public async Task<IActionResult> TestApi()
        {
            return Ok("Success");
        }

        [HttpGet]
        [RequireHttps]
        [Route(GlobalConstants.TestUniqa)]
        public async Task<IActionResult> TestUniqa()
        {
            var result = await this._uniqaInsuranceService.TestSoap();
            return Ok(result.Body.CalculateTravelPremiumResult);
        }

